import "./quantityPicker.css";


const QuantityPicker = () => {
    
    return (
        <div className="quantityPicker">
            <button className="btn btn-primary btn-sm">-</button>
            <label>{1+1}</label>
            <button className="btn btn-primary btn-sm">+</button>
        </div>
    );
}

export default QuantityPicker;
